function SkillBar(props) {
    if (props.skill == null || props.progress == null || props.color == null) {
        return null
    }

    return(
        <div style={{width: '900px', backgroundColor:"black"}}>
            <h1>{props.skill}</h1>
            <div style={{width: '900px', height: '20px'}}>
                <div style={{backgroundColor:`${props.color}`, width: `${props.progress}%`, height: '20px'}}/>
                <div style={{backgroundColor:'gray', width: `${100 - props.progress}%`, height: '20px'}}/>
            </div>
        </div>
    )
}

export default SkillBar;
